function getCsrfToken(){const c=document.cookie.split(";");for(let o of c){o=o.trim();const[k,...v]=o.split("=");if(k==="{{.CookieName}}")return v.join("=")}return null}function setCsrfToken(){const t=getCsrfToken();if(t===null)return;document.cookie=`js_{{.CookieName}}=${t};path=/;samesite=lax`}setCsrfToken();
